import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Cambiado Switch a Routes
import UserForm from './components/UserForm';
import LoginForm from './components/LoginForm';
import UserList from './components/UserList';

const App = () => {
    return (
        <Router>
            <div>
                <Routes> {/* Cambiado Switch a Routes */}
                    <Route path="/login" element={<LoginForm />} /> {/* Usar element en vez de component */}
                    <Route path="/register" element={<UserForm />} />
                    <Route path="/users" element={<UserList />} />
                    <Route path="/" element={<LoginForm />} />
                </Routes>
            </div>
        </Router>
    );
};

export default App;
